import React, { useState, useEffect } from "react";

function DoadorList() {
  const [doadores, setDoadores] = useState([]);

  // Função para buscar doadores no servidor
  const fetchDoadores = async () => {
    try {
      const response = await fetch("http://localhost:8080/doadores");
      const data = await response.json();
      setDoadores(data);
    } catch (error) {
      console.error("Erro ao buscar doadores:", error);
    }
  };

  // Chama a função de buscar doadores ao carregar o componente
  useEffect(() => {
    fetchDoadores();
  }, []);

  return (
    <div>
      <h2>Lista de Doadores</h2>
      <table>
        <thead>
          <tr>
            <th>CPF</th>
            <th>Nome</th>
            <th>Idade</th>
            <th>Sexo</th>
            <th>Tipo Sanguíneo</th>
            <th>Quantidade de Bolsas Doadas</th>
          </tr>
        </thead>
        <tbody>
          {doadores.map((doador) => (
            <tr key={doador.pessoa.cpf}>
              <td>{doador.pessoa.cpf}</td>
              <td>{doador.pessoa.nome}</td>
              <td>{doador.pessoa.idade}</td>
              <td>{doador.sexo}</td>
              <td>{doador.pessoa.tipoSanguineo}</td>
              <td>{doador.qtdBolsasDoadas}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default DoadorList;
